svgEngineApp.getAnimationsView = function() {return svgEngineApp.mainView.getAnimationsView();};

defs.script:
var svgtk = {};
svgtk.checkTypeOfMember = function(o,m) {
	try {return typeof(o[m])!='undefined';} catch(ex) {return false;}
};
svgtk.callWindowParentFunction = function(m) {
	if(svgtk.checkTypeOfMember(window.parent, m)) window.parent[m]();
};
svgtk.callWindowParentFunction1 = function(m,a1) {
	if(svgtk.checkTypeOfMember(window.parent, m)) window.parent[m](a1);
};
var svgDraw = {};
svgDraw.focus = function() {window.focus();};
svgDraw.blur = function() {window.blur();};
svgDraw.pasteIntercept = function(event) {
	try {
	var text = "";
	if (event.clipboardData) text = event.clipboardData.getData("Text"); 
	else if (window.clipboardData) text = window.clipboardData.getData("Text"); 
	if (text!="") svgtk.callWindowParentFunction1('onSvgDrawTextPaste', text);
	} catch(ex) {alert("svgDraw.pasteIntercept "+ex);}
};
svgDraw.addPasteHandler = function() {
	document.documentElement.addEventListener("paste", svgDraw.pasteIntercept, false);
};
svgDraw.removePasteHandler = function() {
	document.documentElement.removeEventListener("paste", svgDraw.pasteIntercept, false);
};
 // API externe
 window['draw-svg-v1-0-js'] = svgDraw;
 window.parent['draw-svg-v1-0-js'] = svgDraw;
